import React from 'react';
import styled from 'styled-components';

const Btn = styled.button`
  background-color: #6400e4;
  border: none;
  color: #fff;  
  padding: 6px 16px;
  font-weight: 700;
  font-size: 16px;
  width: 332px;
  height: 56px;
  border-radius: 50px;
  font-family: 'Nunito Sans', sans-serif;
`;

function Button() {
    return (  
        <Btn>{this.props.text}</Btn>

    );
  }
  export default Button;
